import './App.css';
import { Login } from './Components';
import { Protected } from './Components';
import { Dashboard } from './Components';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from 'react';

class App extends React.Component{
  constructor() {
    super();
    this.clldElement = React.createRef().current;
    console.log(this.clldElement);
    this.user = this.childElement.state.user;
    this.loading = this.childElement.state.loading;
    console.log(this.user);
  }

  render(){
    return (
      <div className="App">
        {/* <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />
                  <p>
                    Edit <code>src/App.js</code> and save to reload.
                  </p>
                  <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Learn React
                  </a>
                </header> */}
        <BrowserRouter>
          <Routes>
            <Route
              path="/"
              element={<Protected ref={this.childElement}>
                <Dashboard user={this.user} loading={this.loading}/>
              </Protected>} />
            <Route path="/login" element={<Login />} />
          </Routes>
        </BrowserRouter>

      </div>
    );
  }
}

export default new App();
